(function($){"use strict";$(document).ready(function(){$(".conf-sch-date-field").datepicker();$("#conf-sch-date").datepicker("option","altField","#conf-sch-date-alt");$("#conf-sch-date").datepicker("option","altFormat","yy-mm-dd");$(".conf-sch-time-field").timepicker({step:15,timeFormat:"g:i a",minTime:"5:00 am"});$("#conf-sch-start-time").on("changeTime",function(){$("#conf-sch-end-time").timepicker("option","minTime",$(this).val())});$("#conf-sch-end-time").timepicker("option","showDuration",true);$("#conf-sch-end-time").timepicker("option","durationTime",function(){return $("#conf-sch-start-time").val()});$("#conf-sch-event-type").select2();$.ajax({url:"/wp-json/wp/v2/schedule_categories",success:function($categories){if($categories===undefined||$categories==""){return false}$.each($categories,function($index,$value){$("#conf-sch-event-type").append('<option value="'+$value.id+'">'+$value.name+"</option>")});$.ajax({url:"/wp-json/wp/v2/schedule/133/schedule_categories",success:function($selected_categories){if($selected_categories===undefined||$selected_categories==""){return false}$.each($selected_categories,function($index,$value){$('#conf-sch-event-type option[value="'+$value.id+'"]').attr("selected",true).trigger("change")})},cache:false})},cache:false})})})(jQuery);